@EU_Commission @mariannethyssen @EU_Social Better protected?

How is a €200/month East EU salary while living and working in a country where a minimum wage is €1100/month protective?

These people are modern slaves.

@EU_Commission You couldn’t settle the Bosnian conflict, the Ukrainian conflict nor the the aggression of Turkey on Cyprus.

You aren’t about peace, you’re about building an empire through trade, with Franco Germanic rules at heart.

You’re about as useful as a condom with a hole in.

@EU_Commission Do you have any jobs that teach common sense ?
I could train, and then in turn train members of the EU Commission.
I have common sense now, but I assume UK common sense does not have a regulatory equivalence within the EU. On second thoughts, dont bother 🎃

@EU_Commission A new religion .. politics of rule .. 
We are your freinds...
do not disobey us or we will destroy you .
